import React, { Component } from 'react';

const Rank = ({name, entries}) => {
	return (
		<div >
			<div className='white f3'>
				{'${name}, your current rank is...'}
			</div>
			<div className='white f1'>
				<Rank name={this.state.user.name} entries={this.state.user.entries}/>
			</div>
		</div>
	);
}

export default Rank;
